<ul>
<li>
<p>进程：是正在运行的程序</p>
<p>​	是系统进行资源分配和调用的独立单位</p>
<p>​	每一个进程都有它自己的内存空间和系统资源</p>
</li>
<li>
<p>线程：是进程中的单个顺序控制流，是一条执行路径</p>
<p>​	单线程：一个进程如果只有一条执行路径，则称为单线程程序</p>
<p>​	多线程：一个进程如果有多条执行路径，则称为多线程程序</p>
</li>
</ul>
